import React, {useState} from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './App.css';

function App() {
  return (
    <div className="App">
      <p>Jayaram</p>
      <Container>
        <Row>
          <Col>AC</Col>
          <Col>/</Col>
          <Col>x</Col>
        </Row>
        <Row>
          <Col>7</Col>
          <Col>8</Col>
          <Col>9</Col>
        </Row>
        <Row>
          <Col>-</Col>
          <Col>4</Col>
          <Col>5</Col>
        </Row>
      </Container>
    </div>
  );
}

export default App;
